const Icon = ({ name }) => {
  switch (name.toLowerCase()) {
    case 'buyer':
      return <Buyer />;
    case 'supplier':
      return <Supplier />;
    case 'transporter':
      return <Transporter />;
    case 'ggcb':
    case 'uscts':
      return <Auditor />;
    case 'factor 1':
    case 'factor 2':
      return <Factor />;
    case 'complete':
      return <Complete />;
    case 'cloud':
      return <Cloud />;
    case 'document':
      return <Document />;
    case 'proof-document':
      return <ProofDocument />;
    case 'transport':
      return <Transport />;
    case 'tick':
      return <Tick />;
    case 'left-arrow':
      return <LeftArrow />;
    default:
      return <Buyer />;
  }
};

